    false,nt"url": null,nt"notes": "This report explains the effects of the
    1996 water levels on the ecology of  Montezuma National Wildlife Refuge and it proposes
    the water surface elevations of the five main impoundments on the refuge for 1997.
    The report outlines the reasoning behind these proposals. The weather in central
    New York throughout 1996 was wet, gray, and cool. This was drastically different
    from the drought year of 1995. Precipitation for the year totaled 46. 7 inches;
    nearly one foot above the long-term average. The above-normal precipitation caused
    several "flood situations" during the year.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
